)

const Content = () => (
  <Container fluid>
    <div className="text-center p-5">

    </div>
  </Container>
)

const Home = () => (
  <StandardLayout title='Home'>
    <SoftwareDevelopmentHeader></SoftwareDevelopmentHeader>

    <Partners></Partners>
  </StandardLayout>
)

export default Home;
